import{BrowserRouter,Routes,Route} from "react-router-dom";
import { Events } from "./events/event";
import { MyForm } from './events/form';

function App() {
  return (
    <div className="App">
      <MyForm/>
      <Events/> 
      <BrowserRouter>
      <Routes>
       <Route path="/" element={<MyForm/>}>


       </Route>

      </Routes>

      </BrowserRouter>

    </div>
  );
}

export default App;
